import React from 'react';
import s from './Header.module.css'
import {Navigate, NavLink} from "react-router-dom";
import {AuthThunk, AuthThunkDeleteLogin} from "../../Readux/Reducer-Auth";
const Header = (props)=>{
    const exitToLogin=()=>{

       props.AuthThunkDeleteLogin()


    }

    return (
        <header className={s.main} >
            <div><img className={s.logo}
                      src="https://upload.wikimedia.org/wikipedia/commons/thumb/a/a7/React-icon.svg/1280px-React-icon.svg.png"/>
            </div>
         <div className={s.wrapper_login}>
             {console.log(props.login)}
             {console.log(props.isAuth)}
             {console.log(props)}
             { props.isAuth ?   <NavLink className={s.login}  to="/login" ></NavLink>:<div>{props.login}  <button onClick={exitToLogin} >Выйти</button></div>}

         </div>

        </header>
    );
}

export default Header;
